import { GET_PERMISSION_SETTING } from '../constants/ActionTypes';

const initialState = {
  permissionSetting: [ ],
};

export default function(state = initialState, action) {
  switch (action.type) {
    case GET_PERMISSION_SETTING:
      return Object.assign({}, state, {
        permissionSetting: action.payload,
      });

    default:
      return state;
  }
}
